import React, { useEffect, useRef } from 'react';
import styled from 'styled-components';

const AboutContainer = styled.section`
  min-height: 100vh;
  background: #000;
  position: relative;
  overflow: hidden;
  padding: 8rem 2rem;
  color: #fff;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: linear-gradient(45deg, rgba(0,0,0,0.9), rgba(0,0,0,0.7));
    z-index: 1;
  }
`;

const Section = styled.div`
  position: relative;
  z-index: 2;
  max-width: 1400px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 4rem;
  align-items: center;

  @media (max-width: 1024px) {
    grid-template-columns: 1fr;
    gap: 2rem;
  }
`;

const Content = styled.div`
  opacity: 0;
  transform: translateX(-50px);
  animation: fadeInLeft 1s ease forwards;

  @keyframes fadeInLeft {
    to {
      opacity: 1;
      transform: translateX(0);
    }
  }
`;

const Title = styled.h2`
  font-size: 3.5rem;
  font-weight: 700;
  margin-bottom: 2rem;
  background: linear-gradient(90deg, #fff, #00f2fe);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  letter-spacing: -0.02em;
  line-height: 1.1;

  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const Description = styled.p`
  font-size: 1.2rem;
  line-height: 1.8;
  color: rgba(255, 255, 255, 0.8);
  margin-bottom: 2rem;

  &:last-child {
    margin-bottom: 0;
  }
`;

const ImageGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1rem;
  opacity: 0;
  transform: translateX(50px);
  animation: fadeInRight 1s ease forwards;

  @keyframes fadeInRight {
    to {
      opacity: 1;
      transform: translateX(0);
    }
  }
`;

const ImageWrapper = styled.div`
  position: relative;
  overflow: hidden;
  border-radius: 12px;
  aspect-ratio: 1;
  transition: transform 0.3s ease;

  &:hover {
    transform: scale(1.02);
  }

  &::after {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: linear-gradient(45deg, rgba(0,0,0,0.3), rgba(0,0,0,0.1));
    transition: opacity 0.3s ease;
  }

  &:hover::after {
    opacity: 0;
  }
`;

const Image = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.5s ease;

  ${ImageWrapper}:hover & {
    transform: scale(1.1);
  }
`;

const StatsContainer = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2rem;
  margin-top: 4rem;
  opacity: 0;
  transform: translateY(30px);
  animation: fadeInUp 1s ease forwards 0.5s;

  @keyframes fadeInUp {
    to {
      opacity: 1;
      transform: translateY(0);
    }
  }

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const StatItem = styled.div`
  text-align: center;
  padding: 2rem;
  background: rgba(255, 255, 255, 0.05);
  border-radius: 12px;
  backdrop-filter: blur(10px);
  border: 1px solid rgba(255, 255, 255, 0.1);
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    border-color: #00f2fe;
  }
`;

const StatNumber = styled.div`
  font-size: 3rem;
  font-weight: 700;
  background: linear-gradient(90deg, #00f2fe, #4facfe);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  margin-bottom: 0.5rem;
`;

const StatLabel = styled.div`
  font-size: 1.1rem;
  color: rgba(255, 255, 255, 0.8);
`;

const About: React.FC = () => {
  const containerRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    const container = containerRef.current;
    if (!container) return;

    const handleScroll = () => {
      const { top } = container.getBoundingClientRect();
      const windowHeight = window.innerHeight;
      
      if (top < windowHeight * 0.8) {
        container.style.opacity = '1';
        container.style.transform = 'translateY(0)';
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <AboutContainer ref={containerRef}>
      <Section>
        <Content>
          <Title>Our Vision for the Future</Title>
          <Description>
            We're a team of passionate innovators dedicated to pushing the boundaries of what's possible. Our mission is to create technology that not only solves today's problems but also shapes tomorrow's opportunities.
          </Description>
          <Description>
            With a focus on human-centered design and cutting-edge technology, we're building solutions that empower creators and transform industries. Our approach combines deep technical expertise with a commitment to sustainability and social impact.
          </Description>
        </Content>
        <ImageGrid>
          <ImageWrapper>
            <Image src="/images/team-1.jpg" alt="Team collaboration" />
          </ImageWrapper>
          <ImageWrapper>
            <Image src="/images/team-2.jpg" alt="Innovation lab" />
          </ImageWrapper>
          <ImageWrapper>
            <Image src="/images/team-3.jpg" alt="Creative workspace" />
          </ImageWrapper>
          <ImageWrapper>
            <Image src="/images/team-4.jpg" alt="Technology showcase" />
          </ImageWrapper>
        </ImageGrid>
      </Section>
      <StatsContainer>
        <StatItem>
          <StatNumber>150+</StatNumber>
          <StatLabel>Team Members</StatLabel>
        </StatItem>
        <StatItem>
          <StatNumber>25+</StatNumber>
          <StatLabel>Countries</StatLabel>
        </StatItem>
        <StatItem>
          <StatNumber>98%</StatNumber>
          <StatLabel>Client Satisfaction</StatLabel>
        </StatItem>
      </StatsContainer>
    </AboutContainer>
  );
};

export default About;
